import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
  return (
    <header className="navbar navbar-expand-lg navbar-light bg-light">
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarNavDropdown">
            <ul class="navbar-nav">
              <li class="nav-item active">
                <NavLink class="nav-link" >Home <span class="sr-only">(current)</span></NavLink>
              </li>
              <li class="nav-item">
                <NavLink class="nav-link" >Features</NavLink>
              </li>
              <li class="nav-item">
                <NavLink class="nav-link" >Pricing</NavLink>
              </li>
              <li class="nav-item dropdown">
                <NavLink class="nav-link dropdown-toggle"  id="navbarDropdownMenuLink" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                  Dropdown link
                </NavLink>
                <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
                  <NavLink class="dropdown-item" >Action</NavLink>
                  <NavLink class="dropdown-item" >Another action</NavLink>
                  <NavLink class="dropdown-item" >Something else here</NavLink>
                </div>
              </li>
            </ul>
          </div>
      </nav>
    </header>
  );
}

const Footer = () => {
  return (
    <footer className="bg-light text-center text-lg-start">
    <p className="text-center p-3">Â© {new Date().getFullYear()} Mon application</p>
  </footer>
  );
};

export { Header, Footer };
